import axios from 'axios';
import * as CONSTANTS from '../constants';

export const createOrderService = async (order) => {
  try {
    const { data } = await axios.get(`${CONSTANTS.BaseApi}${CONSTANTS.order.createOrder}`,);
    return data
  } catch (error) {
      throw error
  }
};
